import { Link } from "react-router-dom";
import ToFahrenheit from "./components/ToFahrenheit";

function App() {
  return (
    <div className="App">
      <div>
        <Link to={'/'}>Celcius To Fahrenheit</Link >
      </div>

      <ToFahrenheit />
    </div>
  );
}

export default App;
